import React from "react";
import NAvbsr from "./NAvbsr";
import photo from "./images/photo.png";
import EditLocationIcon from "@mui/icons-material/EditLocation";
import CallIcon from "@mui/icons-material/Call";
import AttachEmailIcon from "@mui/icons-material/AttachEmail";

function Resume() {
  return (
    <>
      <NAvbsr />
      <div className="resume_intro">
        <div className="row">
          <div className="col-lg-4 col-md-4 col-sm-4 col-4 resume_profile_photo_component">
            <img src={photo} alt="" className="resume_profile_photo" />
          </div>
          <div className="col-lg-8 col-md-8 col-sm-8 col-8">
            <h1 className="profile_name">PRITAM MULI</h1>
            <div className="row">
              <div className="col-lg-6 col-md-6 col-sm-12 mb-3">
                <CallIcon className="contact_icons" /> +91 9765129019
              </div>
              <div className="col-lg-6  col-md-6 col-sm-12">
                <EditLocationIcon className="contact_icons" /> Garakheda parisar Sambhaji nagar
              </div>
              <div className="col-lg-6 col-md-6 col-sm-12">
                <AttachEmailIcon className="contact_icons" />{" "}
                muli.pritam@gmail.com
              </div>
            </div>
          </div>
        </div>

        <div className="intro_finish"></div>

        <div className="row mb-3">
          <div className="col-lg-5 col-md-5 col-sm-5 col-5 profile_intro">
            <h1>Profile Summary</h1>
          </div>

          <div className="col-lg-1 col-md-1 col-sm-1 col-1"></div>
          <div className="col-lg-6 col-md-6 col-sm-6 col-6">
            <p className="profile_summary">
              With over 2.5 years of experience working in Tata Consultancy Services, I am a skilled front-end developer proficient in HTML, CSS, ReactJS, JavaScript, React Native, and Redux. I have a strong understanding of version control systems like GitHub and project management tools like JIRA. My expertise lies in creating responsive and interactive user interfaces that enhance the overall user experience.
            </p>
          </div>
        </div>

        <div className="row mb-3">
          <div className="col-lg-5 col-md-5 col-sm-5 col-5 profile_intro">
            <h1>Work Experience</h1>
          </div>
          <div className="col-lg-1 col-md-1 col-sm-1 col-1">
            <div className="vertical-line">
              <ul className="vertical-bullets">
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
              </ul>
            </div>
          </div>
          <div className="col-lg-6 col-md-6 col-sm-6 col-6">
            <h5>Assistant System Engineer | Tata Consultancy Services | Dec-2021 - present</h5>
            <details>
              <summary>
                <span className="profile_summary">
                  Internet of Things Digital Engineering | Front-end developer - ReactJS
                </span>
              </summary>
              <ul>
                <li>Developed and maintained user interface for web applications, ensuring optimal performance and responsiveness.</li>
                <li>Collaborated with backend developers and designers to implement visual elements and user interactions.</li>
                <li>Utilized React.js to create reusable components, enhancing code maintainability and scalability.</li>
                <li>Implemented responsive design principles to ensure a seamless user experience across various devices</li>
                <li>Collaborated with UI/UX designers to implement design specifications and enhance user experience.</li>
                <li>Integrated third party APIs to extend application functionality and improve overall performance.</li>
                <li>Participated in agile development processes, including sprint planning and daily stand-up meetings</li>
                <li>Resolve cross-browser compatibility issue and optimized web applications for speed and performance.</li>
              </ul>
            </details>
          </div>
        </div>
      </div>
    </>
  );
}

export default Resume;

